import React from 'react';
import { useNavigate } from 'react-router-dom';
import './SignUp.css';

function SignUp() {
  const navigate = useNavigate();

  const goToLogin = () => {
    navigate('/');
  };

  return (
    <div className='signupmain'>
      <div className="signupform">
        <h2 className='title'>SIGN UP FORM</h2>
        <div className="form">
          <form>
            
            <center><button className='subbt' type="submit">Sign Up</button></center><br />
          </form>
          <center><p>Already have an account?</p></center>
          <center><button className='login-link' onClick={goToLogin}>Login</button></center>
        </div>
      </div>
    </div>
  );
}

export default SignUp;
